DROP TABLE IF EXISTS gdm_gis_device_member CASCADE;

CREATE TABLE gdm_gis_device_member (
    id character varying(50),
    device_id character varying(50),
    member_id character varying(50) NOT NULL,
    is_default boolean NOT NULL,
    operator character varying(50) NOT NULL,
    valid numeric(1,0) DEFAULT 1,
    create_time bigint NOT NULL,
    update_time bigint NOT NULL,
    org character varying(255) NOT NULL
);


CREATE INDEX ds_gis_device_member_device_id_idx ON gdm.gdm_gis_device_member USING btree (device_id);
CREATE INDEX ds_gis_device_member_member_id_idx ON gdm.gdm_gis_device_member USING btree (member_id);
CREATE UNIQUE INDEX pk_ds_gis_device_member ON gdm.gdm_gis_device_member USING btree (device_id);

COMMENT ON COLUMN gdm_gis_device_member.id IS 'id';
COMMENT ON COLUMN gdm_gis_device_member.device_id IS '设备id';
COMMENT ON COLUMN gdm_gis_device_member.member_id IS '成员id';
COMMENT ON COLUMN gdm_gis_device_member.is_default IS '是否为主用';
COMMENT ON COLUMN gdm_gis_device_member.operator IS '操作用户';
COMMENT ON COLUMN gdm_gis_device_member.valid IS '有效性,0-无效,1-有效';
COMMENT ON COLUMN gdm_gis_device_member.create_time IS '创建时间';
COMMENT ON COLUMN gdm_gis_device_member.update_time IS '更新时间';
COMMENT ON COLUMN gdm_gis_device_member.org IS 'org';

